import React from 'react'
import top from './top.css';
function Top() {
    return (
        <div className='top1'>
            <div className='top-main'>
                <div className='fir'>
                    <p>the</p>
                </div>
                <div sec='sec'>
                    <h3>Siren</h3>
                </div>
            </div>
            <div className='getstart'>
                <p>Get Started</p>
            </div>
        </div>
    )
}

export default Top;
